  "id": 7012910170174,
  "title": "Happi Doggy Vegetarian Dental Chew - Zest - Mint (Singles) - 25 g",
  "handle": "happi-doggy-vegetarian-dental-chew-zest-mint-singles-25-g",
  "description": "<p><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-02_1024x1024.jpg?v=1600865517\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p>\n<p>Happi Doggy Mint Dental Chews are ideal to counter 'doggy' breath. These mint treats have germicidal properties that are great to freshen breath. They also have vitamins A, M, H and E. Mint is also known for relieving stomach pain and nausea. These dental chews remove plaque and tartar stains as your pet chews on them.</p>\n<p><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-14_480x480.jpg?v=1600865775\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Mint freshens breath<br>\n</li>\n<li>Also helps relieve stomach pains and nausea</li>\n<li>Treat size: 4 Inch</li>\n<li>Prevents plaque build-up and removes tartar stains</li>\n<li>Grain-free, gluten treats</li>\n<li>Aids dental hygiene</li>\n<li>Plant-based ingredients</li>\n<li>Zest range has treats fortified with Perilla and Eucalyptus oil</li>\n<li>Suitable for all life stages and breeds</li>\n<li>No meat, meat by-products or filler ingredients</li>\n<li>Specially designed with bristles to scrape off plaque and tartar</li>\n</ul>\n<p><img alt=\"\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-06_480x480.jpg?v=1600865532\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p>\n<p><strong>Ingredients:</strong> Tapioca starch, Powdered cellulose, Pea flour, Glycerin, Apple fibre, Sodium caseinate, Lactobacillus acidophilus, Calcium citrate, Sodium hexametaphosphate, Lecithin, Mint oil, Perilla extract, Prebiotics, Yeast cell wall polysaccharide, carmine, Chlorophyllin, Copper complex, Eucalyptus Oil</p>\n<p><strong>Precautions:</strong><br></p>\n<ul>\n<li>Check ingredients for possible allergens</li>\n<li>Always check with a vet before you alter your pet's diet</li>\n<li>Always have clean water available for your pet</li>\n</ul>\n<p><strong>HUFT Tip:</strong> <span>Dental health is often neglected by pet parents but its very important for your dogs overall health. If periodontal diseases are not countered, it can lead to a number of more serious health issues. The bacteria can enter the bloodstream and affect major organs. Besides brushing their teeth, giving dogs dental chews and treats help keep their pearly whites in good shape. The number of treats you can give your pet per day depends on the size of your dog and the size of the treat. As a rule of thumb, it is recommended that your pet's treats be no more than 10% of their daily calorie intake.</span></p>\n<p><strong><span style=\"text-align: center;\">Happi Doggy Dog Treats has a lot more flavor and variety to offer. </span><a href=\"https://headsupfortails.com/collections/happi-doggy\" style=\"text-align: center;\" target=\"_blank\">Click here</a><span style=\"text-align: center;\"> to find out.</span></strong></p>\n<style><!--\n.resize\n{\nfont-size: 18px;\n}\n--></style>",
