  "title": "Happi Doggy Vegetarian Dental Chew - Zest - Strawberry Petite - 2.5 inch - 150 g - 18 Pieces",
  "handle": "happi-doggy-dental-chew-zest-strawberry-150-gms",
  "description": "<p><img alt=\"Happi Doggy Dental Chew - Zest - Strawberry - 150 g\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-02_1024x1024.jpg?v=1600865517\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p>\n<p>These Happi Doggy Dental Chews are made with real strawberries to give your pet vitamins and minerals naturally. Strawberries contain antioxidants and an enzyme that helps keep teeth white by breaking down tartar. These dental chews help remove plaque build-up, keeping your pet's teeth white and gums, healthy.</p>\n<p><img alt=\"Happi Doggy Dental Chew - Zest - Strawberry - 150 g\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-11_480x480.jpg?v=1600865741\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Strawberry is the 3rd best food for better dental health<br>\n</li>\n<li>Prevents plaque build-up and removes tartar stains</li>\n<li>Treat size: 2.5 Inch<br>\n</li>\n<li>Weight: 150 g</li>\n<li>Pack contains: 18 pieces</li>\n<li>Grain-free, gluten treats</li>\n<li>Aids dental hygiene</li>\n<li>Plant-based ingredients</li>\n<li>Zest range has treats fortified with Perilla and Eucalyptus oil</li>\n<li>Suitable for all life stages and breeds</li>\n<li>No meat, meat by-products or filler ingredients</li>\n<li>Specially designed with bristles to scrape off plaque and tartar</li>\n</ul>\n<p><img alt=\"Happi Doggy Dental Chew - Zest - Strawberry - 150 g\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-06_480x480.jpg?v=1600865532\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p>\n<p><strong>Ingredients: </strong>Tapioca starch, Powdered cellulose, Pea flour, Glycerin, Apple fibre, Sodium caseinate, Lactobacillus acidophilus, Calcium citrate, Sodium hexametaphosphate, Lecithin, Strawberry Powder, Perilla extract, Prebiotics, Yeast cell wall polysaccharide, Annatto extract, Eucalyptus Oil.</p>\n<p><strong>Precautions:</strong><br></p>\n<ul>\n<li>Check ingredients for possible allergens</li>\n<li>Always check with a vet before you alter your pet's diet</li>\n<li>Always have clean water available for your pet</li>\n</ul>\n<p><strong>HUFT Tip: </strong>Dental health is often neglected by pet parents but its very important for your dogs overall health. If periodontal diseases are not countered, it can lead to a number of more serious health issues. The bacteria can enter the bloodstream and affect major organs. Besides brushing their teeth, giving dogs dental chews and treats help keep their pearly whites in good shape. The number of treats you can give your pet per day depends on the size of your dog and the size of the treat. As a rule of thumb, it is recommended that your pet's treats be no more than 10% of their daily calorie intake.</p>\n<p><strong>Happi Doggy Dog Treats has a lot more variety and flavors to offer. <a href=\"https://headsupfortails.com/collections/happi-doggy\" target=\"_blank\">Click here</a> to find out.</strong></p>\n<style><!--\n.resize\n{\nfont-size: 18px;\n}\n--></style>",
