  "description": "<p data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Great source of antioxidants and dietary fiber that help boost immune function of the body.</span></p>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Benefits</strong></p>\n<ul data-mce-fragment=\"1\" class=\"\">\n<li data-mce-fragment=\"1\" data-spm-anchor-id=\"a2o42.pdp_revamp.product_detail.i0.234e2cb1Ak56A6\" class=\"\">Weight - 150 g</li>\n<li data-mce-fragment=\"1\" data-spm-anchor-id=\"a2o42.pdp_revamp.product_detail.i0.234e2cb1Ak56A6\" class=\"\">Treat size - 4 inch</li>\n<li data-mce-fragment=\"1\" data-spm-anchor-id=\"a2o42.pdp_revamp.product_detail.i0.234e2cb1Ak56A6\" class=\"\">Pack Contains: 6 pieces</li>\n<li data-mce-fragment=\"1\" data-spm-anchor-id=\"a2o42.pdp_revamp.product_detail.i0.234e2cb1Ak56A6\" class=\"\">Supports boost in overall health</li>\n<li data-mce-fragment=\"1\" class=\"\">2x longer-lasting for better dental health</li>\n<li data-mce-fragment=\"1\" class=\"\">Grain-free, gluten-free</li>\n<li data-mce-fragment=\"1\" class=\"\" data-spm-anchor-id=\"a2o42.pdp_revamp.product_detail.i1.234e2cb1Ak56A6\">100% meat free, rawhide-free</li>\n<li data-mce-fragment=\"1\" class=\"\">Freshens breath naturally</li>\n</ul>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Additional Benefits</strong></p>\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Yucca Extract</strong></li>\n<li data-mce-fragment=\"1\">Reduces waste-odor by as much as 26%.</li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Rosemary Extract</strong></li>\n<li data-mce-fragment=\"1\">Inhibits the formation of dental biofilm by reducing the adherence of pathogens to dental surfaces.</li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Distiller's Yeast</strong></li>\n<li data-mce-fragment=\"1\">A Probiotic that aids digestion.</li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Platycodon Grandiflorum</strong></li>\n<li data-mce-fragment=\"1\">Extracts (saponins) from the roots of this plant may exhibit antimicrobial, anti-inflammatory, antimicrobial, anti-inflammatory, anti-allergy properties.</li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Galacto-Oligosaccharides</strong></li>\n<li data-mce-fragment=\"1\">Classified as Prebiotics. Defined as non-digestible food ingredients. Stimulate the growth and/or activity of beneficial bacteria in the colon.</li>\n</ul>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Ingredients: </strong>Sweet Potato Powder, Pea Flour, Powdered Cellulose, Glycerin, Turmeric, Shiitake, Yucca Extract, Rosemary Extract, Platycodon Grandiflorum, Distiller's Yeast, Ascophyllum Nodosum, Galacto-Oligosaccharides, D-Sorbitol, Sodium Caseinate, Enterococcus Faecium, Sodium Hexametaphosphate.</p>\n<div data-mce-fragment=\"1\" class=\"accordionContent\">\n<div data-mce-fragment=\"1\" class=\"accordionButton on\"><strong data-mce-fragment=\"1\">Guaranteed Analysis</strong></div>\n<div data-mce-fragment=\"1\" class=\"accordionContent\">\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\">Crude Protein 5%</li>\n<li data-mce-fragment=\"1\">Crude Fat 7%</li>\n<li data-mce-fragment=\"1\">Crude Fibre 9.0%</li>\n<li data-mce-fragment=\"1\">Crude Ash .5%</li>\n<li data-mce-fragment=\"1\">Moisture 13%</li>\n<li data-mce-fragment=\"1\">Calcium .14%</li>\n<li data-mce-fragment=\"1\">Total Phosphorus 12%</li>\n</ul>\n</div>\n</div>",
