  "description": "<p><img alt=\"Happi Doggy Vegetarian Dental Chew - Zest - Apple - 150 g\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-02_1024x1024.jpg?v=1600865517\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p>\n<p>These Happi Doggy Dental Chews are made with real apples (without the seeds). As your dog enjoys chewing on them, the treats scrape off plaque and tartar stains. These treats are a good source of Vitamins H, E, A and M. Omega fatty acids 3 and 6 are great for your pet's skin and coat.<br></p>\n<p><img alt=\"Happi Doggy Dental Chew Zest Apple 150 gm\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-13_480x480.jpg?v=1600865765\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Apple (without the seeds)<br>\n</li>\n<li>Prevents plaque build-up and removes tartar stains</li>\n<li>Grain-free, gluten treats</li>\n<li>Aids dental hygiene</li>\n<li>Plant-based ingredients</li>\n<li>Weight: 150 g<br>\n</li>\n<li>Treat Size: 2.5 Inch</li>\n<li>Pack contains: 18 pieces</li>\n<li>Zest range has treats fortified with Perilla and Eucalyptus oil</li>\n<li>Suitable for all life stages and breeds</li>\n<li>No meat, meat by-products or filler ingredients</li>\n<li>Specially designed with bristles to scrape off plaque and tartar</li>\n</ul>\n<p><img alt=\"Happi Doggy Dental Chew Zest Apple 150 gm\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-06_480x480.jpg?v=1600865532\" style=\"display: block; margin-left: auto; margin-right: auto;\"></p>\n<p><strong>Ingredients: </strong>Tapioca starch, Powdered, Pea flour, Glycerin, Apple fiber, Sodium caseinate, Lactobacillus acidophilus, Calcium, Sodium hexametaphosphate, Lecithin, Apple Powder, Perilla extract, Prebiotics, Yeast cell wall polysaccharide, carmine, Eucalyptus Oil.</p>\n<div><span><span><strong></strong></span></span></div>\n<div>\n<span><span><strong>Precautions:</strong><br></span></span>\n<ul>\n<li><span>Check ingredients for possible allergens</span></li>\n<li><span>Always check with a vet before you alter your pet's diet</span></li>\n</ul>\n</div>\n<p><strong>HUFT Tip: </strong>Dental health is often neglected by pet parents but it's very important for your dog's overall health. If periodontal diseases are not countered, it can lead to a number of more serious health issues. The bacteria can enter the bloodstream and affect major organs. Besides brushing their teeth, giving dogs dental chews and treats help keep their pearly whites in good shape. The number of treats you can give your pet per day depends on the size of your dog and the size of the treat. As a rule of thumb, it is recommended that your pet's treats be no more than 10% of their daily calorie intake.<br></p>\n<p><strong>Happi Doggy Dog Treats has a lot more to offer. <a href=\"https://headsupfortails.com/collections/happi-doggy\" target=\"_blank\">Click here</a> to find out.</strong></p>",
