  "description": "<div data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">So yummy and nutritious for your good boi or girl! With anti-inflammatory and antioxidants, and rich in Vitamin E and Omega-3, your floofer can enjoy moisturized skin and shiny fur with our Honey &amp; Coconut Oil Happi Doggy Care Dental Chew!</span></div>\n<div data-mce-fragment=\"1\">\n<span data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\"></strong></span><br data-mce-fragment=\"1\">\n</div>\n<div data-mce-fragment=\"1\"><span data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Honey &amp; Coconut Oil- </strong>Good for overall skin health as they contain anti-inflammatory, antioxidant, and antiseptic properties. Coconut oil works as a moisturizer to keep the skin smooth.</span></div>\n<div data-mce-fragment=\"1\">\n<br><span data-mce-fragment=\"1\"></span>\n</div>\n<div data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Features:</strong></div>\n<div data-mce-fragment=\"1\">\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Treat Size : 2.5inch</span></li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Pack contains: 18 Pieces</span></li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Package weight: 150 g</span></li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Formulated to boost immunity</span></li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">2x longer-lasting for better dental health</span></li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Grain-free, gluten-free</span></li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">100% meat free, rawhide-free</span></li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Freshens breath naturally</span></li>\n</ul>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Additional Benefits</strong></p>\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Yucca Extract</strong></li>\n<li data-mce-fragment=\"1\">Reduces waste-odor by as much as 26%.</li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Rosemary Extract</strong></li>\n<li data-mce-fragment=\"1\">Inhibits the formation of dental biofilm by reducing the adherence of pathogens to dental surfaces.</li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Distiller's Yeast</strong></li>\n<li data-mce-fragment=\"1\">A Probiotic that aids digestion.</li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Platycodon Grandiflorum</strong></li>\n<li data-mce-fragment=\"1\">Extracts (saponins) from the roots of this plant may exhibit antimicrobial, anti-inflammatory, antimicrobial, anti-inflammatory, anti-allergy properties.</li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Galacto-Oligosaccharides</strong></li>\n<li data-mce-fragment=\"1\">Classified as Prebiotics. Defined as non-digestible food ingredients. Stimulate the growth and/or activity of beneficial bacteria in the colon.</li>\n</ul>\n<div data-mce-fragment=\"1\" class=\"accordionButton on\">\n<strong data-mce-fragment=\"1\">Ingredients: </strong>Sweet Potato Powder, Pea Flour, Powdered Cellulose, Glycerin, Honey, Coconut Oil , Yucca Extract, Rosemary Extract, Platycodon Grandiflorum, Distiller's Yeast, Ascophyllum Nodosum, Galacto-Oligosaccharides, D-Sorbitol, Sodium Caseinate, Enterococcus Faecium, Sodium Hexametaphosphate</div>\n<div data-mce-fragment=\"1\" class=\"accordionButton on\"><strong data-mce-fragment=\"1\"></strong></div>\n<div data-mce-fragment=\"1\" class=\"accordionButton on\"><strong data-mce-fragment=\"1\"></strong></div>\n<div data-mce-fragment=\"1\" class=\"accordionButton on\"><strong data-mce-fragment=\"1\">Guaranteed Analysis</strong></div>\n<div data-mce-fragment=\"1\" class=\"accordionContent\">\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\">Crude Protein 6.5%</li>\n<li data-mce-fragment=\"1\">Crude Fat 5.7%</li>\n<li data-mce-fragment=\"1\">Crude Fibre 9.0%</li>\n<li data-mce-fragment=\"1\">Crude Ash 2.5%</li>\n<li data-mce-fragment=\"1\">Moisture 13%</li>\n<li data-mce-fragment=\"1\">Calcium 0.14%</li>\n<li data-mce-fragment=\"1\">Total Phosphorus 0.12%</li>\n</ul>\n</div>\n</div>",
