  "title": "Happi Doggy Vegetarian Dental Chew - Care (Digestive Support) - Pumpkin & Mountain Yam - 4 inch 150 g - 6 Pieces",
  "handle": "happi-doggy-vegetarian-dental-chew-care-digestive-support-pumpkin-mountain-yam-4-inch-150-g-6-pieces",
  "description": "<p data-mce-fragment=\"1\"><img src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-02_1024x1024.jpg?v=1600865517\" alt=\"Happi Doggy Dental Chew\" data-mce-fragment=\"1\" data-mce-src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-02_1024x1024.jpg?v=1600865517\"></p>\n<p data-mce-fragment=\"1\">The Care range from Happi Doggy is specially made to counter digestive issues and problems with your dog's skin and coat. This range has an Active+ ingredient that is distilled from essential plant oils. It prevents plaque from building up, removes tartar stains and kills bacteria. The Happi Doggy Dental Chew Care Pumpkin &amp; Mountain Yam is made for digestive support. These two key ingredients encourage the absorption of nutrients and bind loose stools. It strengthens digestive functioning and relieves fatigue.</p>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Features:</strong></p>\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\">Treat size: 4 Inch</li>\n<li data-mce-fragment=\"1\">Part of the Care range with Active+ ingredient<br>\n</li>\n<li data-mce-fragment=\"1\">Plant-based ingredients</li>\n<li data-mce-fragment=\"1\">Pack Contains: 6 Pieces</li>\n<li data-mce-fragment=\"1\">Contains Mountain Yam and Pumpkin</li>\n<li data-mce-fragment=\"1\">The curved design massage the gums</li>\n<li data-mce-fragment=\"1\">Different sizes suitable for all breeds and lifestages</li>\n<li data-mce-fragment=\"1\">Grain-free, gluten treats</li>\n<li data-mce-fragment=\"1\">No meat, meat by-products or filler ingredients</li>\n<li data-mce-fragment=\"1\">In addition to aiding dental hygiene, these treats also provide digestive support. They are enhanced with pre-biotics.</li>\n</ul>\n<p data-mce-fragment=\"1\"><img src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-10_480x480.jpg?v=1600865730\" alt=\"Happi Doggy Dental Chew Pumpkin and Yam\" data-mce-fragment=\"1\" data-mce-src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-10_480x480.jpg?v=1600865730\"></p>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Benefits</strong></p>\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\">Help prevent plaque build-up, removes tartar stains, and kills bacteria</li>\n<li data-mce-fragment=\"1\">Help keep bad breath at bay</li>\n<li data-mce-fragment=\"1\">Aids dental hygiene</li>\n<li data-mce-fragment=\"1\">Specially designed with bristles to scrape off plaque and tartar</li>\n</ul>\n<ul data-mce-fragment=\"1\"></ul>\n<p data-mce-fragment=\"1\"><img src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-06_480x480.jpg?v=1600865532\" alt=\"Happi Doggy Vegetarian Dental Chew - Care (Digestive Support) - Pumpkin &amp; Mountain Yam - 150 g\" data-mce-fragment=\"1\" data-mce-src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-06_480x480.jpg?v=1600865532\"></p>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Ingredients: </strong>Tapioca starch, Powdered cellulose, Pea flour, Glycerin, Apple fibre, Sodium caseinate, Lactobacillus acidophilus, Calcium citrate, Sodium hexametaphosphate, Lecithin, Pumpkin powder, Mountain Yam powder, Perilla extract, Prebiotics, Yeast cell wall polysaccharide, Sunset yellow, Eucalyptus Oil.<br></p>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Why did we include this in our inventory?</strong></p>\n<p data-mce-fragment=\"1\">Dental health is often neglected by pet parents but its very important for your dogs overall health. Diseases like periodontitis, if left untreated, can affect the functioning of other organs as well. Dental diseases can also be very painful for dogs. Besides brushing their teeth, giving dogs dental chews and treats help keep their pearly whites in good shape. These treats make a chore enjoyable for doggies as well.</p>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Approximate Feeding Guideline:</b><br data-mce-fragment=\"1\"></p>\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\">Fresh drinking water should always be available for your dog.</li>\n<li data-mce-fragment=\"1\">As with any edible product, monitor your dog to ensure that the treat is adequately chewed. Gulping any item without thorough chewing may be harmful.</li>\n<li data-mce-fragment=\"1\">\n<span data-mce-fragment=\"1\">Please supervise your pet while giving a chew and dispose of it properly if it becomes a choking hazard </span><span data-mce-fragment=\"1\">or develops sharp edges.</span>\n</li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">This product is intended for intermittent or supplemental feeding only.</span></li>\n</ul>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">HUFT Tip: </strong>The number of treats you can give your pet per day depends on the size of your dog and the size of the treat. As a rule of thumb, it is recommended that your pet's treats be no more than 10% of their daily calorie intake.</p>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Happi Doggy Dog Treats has a lot more to offer. <span data-mce-fragment=\"1\"></span><a href=\"https://headsupfortails.com/collections/happi-doggy\" data-mce-fragment=\"1\" data-mce-href=\"https://headsupfortails.com/collections/happi-doggy\" target=\"_blank\">Click here</a> <span data-mce-fragment=\"1\"></span>to</strong></p>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Happi Doggy Dog Treats has a lot more variety and flavors to choose from. <span data-mce-fragment=\"1\"></span><a href=\"https://headsupfortails.com/collections/happi-doggy\" data-mce-fragment=\"1\" data-mce-href=\"https://headsupfortails.com/collections/happi-doggy\" target=\"_blank\">Click here</a> <span data-mce-fragment=\"1\"></span>to find out.</strong></p>",
