  "handle": "happi-doggy-dental-chew-care-hip-joint-support-rosehip-okra-regular-4-inch-150-g-6-pieces",
  "description": "<div class=\"catalog_item_desc\" data-mce-fragment=\"1\">\n<p data-mce-fragment=\"1\">Let doggo be happy and active with our Rosehip &amp; Okra Happi Doggy Care Dental Chew! Rich in polyphenols, anthocyanins, antioxidants, vitamins, and minerals, joint discomfort will be eased to encourage more jumping and playing!</p>\n</div>\n<div class=\"catalog_slider\" data-mce-fragment=\"1\">\n<div class=\"catalog_item_img slick-initialized slick-slider\" data-mce-fragment=\"1\">\n<div class=\"slick-list draggable\" data-mce-fragment=\"1\">\n<div class=\"slick-track\" data-mce-fragment=\"1\">\n<div tabindex=\"-1\" aria-hidden=\"true\" data-slick-index=\"-1\" class=\"slick-slide slick-cloned\" data-mce-fragment=\"1\" data-mce-tabindex=\"-1\">\n<div data-mce-fragment=\"1\">\n<strong data-mce-fragment=\"1\">Features:</strong><br data-mce-fragment=\"1\">\n</div>\n<div data-mce-fragment=\"1\">\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Supports stronger joint mobility</span></li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">2x longer-lasting for better dental health</span></li>\n<li data-mce-fragment=\"1\">Treat size: 4 inch</li>\n<li data-mce-fragment=\"1\">Grain-free, gluten-free<br>\n</li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">100% meat free, rawhide-free</span></li>\n<li data-mce-fragment=\"1\">Pack Contains: 6 Pieces</li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Freshens breath naturally</span></li>\n</ul>\n</div>\n</div>\n<div tabindex=\"-1\" aria-hidden=\"true\" data-slick-index=\"2\" class=\"slick-slide slick-cloned\" data-mce-fragment=\"1\" data-mce-tabindex=\"-1\">\n<div data-mce-fragment=\"1\">\n<strong data-mce-fragment=\"1\">Additional Benefits</strong><br data-mce-fragment=\"1\">\n</div>\n<div data-mce-fragment=\"1\">\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Yucca Extract</strong></li>\n<li data-mce-fragment=\"1\">Reduces waste-odor by as much as 26%.</li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Rosemary Extract</strong></li>\n<li data-mce-fragment=\"1\">Inhibits the formation of dental biofilm by reducing the adherence of pathogens to dental surfaces.</li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Distilled Yeast</strong></li>\n<li data-mce-fragment=\"1\">A Probiotic that aids digestion.</li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Platycodon Grandiflorum</strong></li>\n<li data-mce-fragment=\"1\">Extracts (saponins) from the roots of this plant may exhibit antimicrobial, anti-inflammatory, antimicrobial, anti-inflammatory, anti-allergy properties.</li>\n<li data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Galacto-Oligosaccharides</strong></li>\n<li data-mce-fragment=\"1\">Classified as Prebiotics. Defined as non-digestible food ingredients. Stimulate the growth and/or activity of beneficial bacteria in the colon.</li>\n</ul>\n<div class=\"accordionButton on\" data-mce-fragment=\"1\">\n<strong data-mce-fragment=\"1\">Ingredients: </strong>Sweet Potato Powder, Pea Flour, Powdered Cellulose, Glycerin, Rosehip, Okra, Yucca Extract, Rosemary Extract, Platycodon Grandiflorum, Distilled Yeast, Ascophyllum Nodosum, Galacto-Oligosaccharides, D-Sorbitol, Sodium Caseinate, Enterococcus Faecium, Sodium Hexametaphosphate.</div>\n<div class=\"accordionContent\" data-mce-fragment=\"1\">\n<div class=\"accordionButton on\" data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Guaranteed Analysis:</strong></div>\n<div class=\"accordionContent\" data-mce-fragment=\"1\">\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\">Crude Protein 5%</li>\n<li data-mce-fragment=\"1\">Crude Fat 7%</li>\n<li data-mce-fragment=\"1\">Crude Fibre 9.0%</li>\n<li data-mce-fragment=\"1\">Crude Ash .5%</li>\n<li data-mce-fragment=\"1\">Moisture 13%</li>\n<li data-mce-fragment=\"1\">Calcium .14%</li>\n<li data-mce-fragment=\"1\">Total Phosphorus 12%</li>\n</ul>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>",
