  "description": "<div data-mce-fragment=\"1\"><span>So yummy and nutritious for your good boi or girl! With anti-inflammatory and antioxidants, and rich in Vitamin E and Omega-3, your floofer can enjoy moisturised skin and shiny fur with our Honey &amp; Coconut Oil Happi Doggy Care Dental Chew!</span></div>\n<div data-mce-fragment=\"1\"></div>\n<div data-mce-fragment=\"1\"><span><strong></strong></span></div>\n<div data-mce-fragment=\"1\">\n<span><strong>Honey &amp; Coconut Oil - </strong></span><span>Good for overall skin health as they contain anti-inflammatory, antioxidant, and antiseptic properties. Coconut oil works as a moisturizer to keep the skin smooth.</span>\n</div>\n<div data-mce-fragment=\"1\"><span></span></div>\n<div data-mce-fragment=\"1\"></div>\n<div data-mce-fragment=\"1\"><strong></strong></div>\n<div data-mce-fragment=\"1\"><strong>Features:</strong></div>\n<div data-mce-fragment=\"1\">\n<ul>\n<li><span>Treat size: 4 inch</span></li>\n<li><span>Pack Contains: 6 Pieces</span></li>\n<li><span>Package weight: 150 g</span></li>\n<li><span>Formulated to boost immunity</span></li>\n<li><span>2x longer-lasting for better dental health</span></li>\n<li><span>Grain-free, gluten-free</span></li>\n<li><span>100% meat free, rawhide-free</span></li>\n<li><span>Freshens breath naturally.</span></li>\n</ul>\n<p><strong>Additional Benefits:</strong></p>\n<ul>\n<li><strong>Yucca Extract</strong></li>\n<li>Reduces waste-odor by as much as 26%.</li>\n<li><strong>Rosemary Extract</strong></li>\n<li>Inhibits the formation of dental biofilm by reducing the adherence of pathogens to dental surfaces.</li>\n<li><strong>Distiller's Yeast</strong></li>\n<li>A Probiotic that aids digestion.</li>\n<li><strong>Platycodon Grandiflorum</strong></li>\n<li>Extracts (saponins) from the roots of this plant may exhibit antimicrobial, anti-inflammatory, antimicrobial, anti-inflammatory, anti-allergy properties.</li>\n<li><strong>Galacto-Oligosaccharides</strong></li>\n<li>Classified as Prebiotics. Defined as non-digestible food ingredients. Stimulate the growth and/or activity of beneficial bacteria in the colon.</li>\n</ul>\n<div class=\"accordionButton on\"><strong>Ingredients:</strong></div>\n<div class=\"accordionButton on\">\n<strong></strong><br>\n</div>\n<div class=\"accordionContent\">\n<p>Sweet Potato Powder, Pea Flour, Powdered Cellulose, Glycerin, Honey, Coconut Oil, Yucca Extract, Rosemary Extract, Platycodon Grandiflorum, Distiller's Yeast, Ascophyllum Nodosum, Galacto-Oligosaccharides, D-Sorbitol, Sodium Caseinate, Enterococcus Faecium, Sodium Hexametaphosphate</p>\n</div>\n<div class=\"accordionButton on\"><strong>Guaranteed Analysis</strong></div>\n<div class=\"accordionContent\">\n<ul>\n<li data-mce-fragment=\"1\">Crude Protein 5%</li>\n<li data-mce-fragment=\"1\">Crude Fat 7%</li>\n<li data-mce-fragment=\"1\">Crude Fibre 9.0%</li>\n<li data-mce-fragment=\"1\">Crude Ash .5%</li>\n<li data-mce-fragment=\"1\">Moisture 13%</li>\n<li data-mce-fragment=\"1\">Calcium .14%</li>\n<li data-mce-fragment=\"1\">Total Phosphorus 12%</li>\n</ul>\n</div>\n</div>",
