  "id": 2026550853694,
  "title": "Happi Doggy Vegetarian Dental Chew - Care (Digestive Support) - Pumpkin & Mountain Yam - Petite - 2.5 inch -150 g - 18 Pieces",
  "handle": "happi-doggy-dental-chew-care-pumpkin-mountain-yam-150-gms",
  "description": "<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-02_1024x1024.jpg?v=1600865517\" alt=\"Happi Doggy Dental Chew\"></p>\n<p>The Care range from Happi Doggy is specially made to counter digestive issues and problems with your dog's skin and coat. This range has an Active+ ingredient that is distilled from essential plant oils. It prevents plaque from building up, removes tartar stains and kills bacteria. The Happi Doggy Dental Chew Care Pumpkin &amp; Mountain Yam is made for digestive support. These two key ingredients encourage the absorption of nutrients and bind loose stools. It strengthens digestive functioning and relieves fatigue.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Treat size: 2.5 Inch</li>\n<li>Pack contains: 18 pieces</li>\n<li>Part of the Care range with Active+ ingredient</li>\n<li>Plant-based ingredients</li>\n<li>Contains Mountain Yam and Pumpkin</li>\n<li>The curved design massage the gums</li>\n<li>Different sizes suitable for all breeds and lifestages</li>\n<li>Grain-free, gluten treats</li>\n<li>No meat, meat by-products or filler ingredients</li>\n<li>In addition to aiding dental hygiene, these treats also provide digestive support. They are enhanced with pre-biotics.</li>\n</ul>\n<p> </p>\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-10_480x480.jpg?v=1600865730\" alt=\"Happi Doggy Dental Chew Pumpkin and Yam\"></p>\n<p><strong>Benefits</strong></p>\n<ul>\n<li>Help prevent plaque build-up, removes tartar stains, and kills bacteria</li>\n<li>Help keep bad breath at bay</li>\n<li>Aids dental hygiene</li>\n<li>Specially designed with bristles to scrape off plaque and tartar</li>\n</ul>\n<ul></ul>\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://cdn.shopify.com/s/files/1/0086/0795/7054/files/Happi_Doggy-_EBC-06_480x480.jpg?v=1600865532\" alt=\"Happi Doggy Vegetarian Dental Chew - Care (Digestive Support) - Pumpkin &amp; Mountain Yam - 150 g\"></p>\n<p><strong>Ingredients: </strong>Tapioca starch, Powdered cellulose, Pea flour, Glycerin, Apple fibre, Sodium caseinate, Lactobacillus acidophilus, Calcium citrate, Sodium hexametaphosphate, Lecithin, Pumpkin powder, Mountain Yam powder, Perilla extract, Prebiotics, Yeast cell wall polysaccharide, Sunset yellow, Eucalyptus Oil.<br></p>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Why did we include this in our inventory?</strong></p>\n<p data-mce-fragment=\"1\">Dental health is often neglected by pet parents but its very important for your dogs overall health. Diseases like periodontitis, if left untreated, can affect the functioning of other organs as well. Dental diseases can also be very painful for dogs. Besides brushing their teeth, giving dogs dental chews and treats help keep their pearly whites in good shape. These treats make a chore enjoyable for doggies as well.</p>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Approximate Feeding Guideline:</b><br data-mce-fragment=\"1\"></p>\n<ul>\n<li>Fresh drinking water should always be available for your dog.</li>\n<li>As with any edible product, monitor your dog to ensure that the treat is adequately chewed. Gulping any item without thorough chewing may be harmful.</li>\n<li>\n<span>Please supervise your pet while giving a chew and dispose of it properly if it becomes a choking hazard </span><span>or develops sharp edges.</span>\n</li>\n<li><span>This product is intended for intermittent or supplemental feeding only.</span></li>\n</ul>\n<p><strong>HUFT Tip: </strong>The number of treats you can give your pet per day depends on the size of your dog and the size of the treat. As a rule of thumb, it is recommended that your pet's treats be no more than 10% of their daily calorie intake.</p>\n<p><strong>Happi Doggy Dog Treats has a lot more variety and flavors to choose from. <a href=\"https://headsupfortails.com/collections/happi-doggy\" target=\"_blank\">Click here</a> to find out.</strong></p>\n<style><!--\n.resize\n{\nfont-size: 18px;\n}\n--></style>",
